import React, {Component} from 'react';


class FooterEg extends Component{
  
  changed(){
    console.log('changed')
  }

  render(){
    return (
      <div>
        <h3 onClick={this.props.myalert}>The Footer {this.props.message} </h3>
        <input onChange={this.changed} type='text'/>
      </div>
    )
  }
}

export default FooterEg;
